import React from 'react';
import Article from './components/Article';
import { useState } from 'react';
import Header from './components/Header/header';
import Menu from './components/Menu/menu';
import Main from './components/Main';
import Aside from './components/Aside';
import Footer from './components/Footer/footer';
import Comment from './components/Comment';

function App() {

  const [name, setName] = useState('Celke!');
  const [age, setAge] = useState('23');
  const [email, setEmail] = useState('fernandoventurini9@hotmail.com');

  const comment = {
    date: new Date(),
    text: "Hello",
    author: {
      name: 'Cesar',
      avatarUrl: 'https://www.google.com/imgres?imgurl=https%3A%2F%2Fgiraomundo.wordpress.com%2Fwp-content%2Fuploads%2F2014%2F12%2Fny-natal2.jpg&tbnid=GyAnR-jZiDJdjM&vet=10CAoQxiAoBGoXChMI6LrBtOX4jgMVAAAAAB0AAAAAEAc..i&imgrefurl=https%3A%2F%2Fgiraomundo.wordpress.com%2F2014%2F12%2F08%2Fnatal-na-neve-top-destinos%2F&docid=NEBPnnNJqKehMM&w=500&h=750&itg=1&q=cidade%20natalina%20nevando&hl=pt-BR&ved=0CAoQxiAoBGoXChMI6LrBtOX4jgMVAAAAAB0AAAAAEAc'
    }
  }

  return (
    <div>
      <Header/>
      <Menu/>
      <Main/>
      <Article/>
      <Comment 
        date={comment.date}
        text={comment.text}
        author={comment.author} 
      />
      <Aside/>
      <Footer/>
      <h1>Tecnology & Programming!!!</h1>
      <hr/>
      <h2>Welcome {name}</h2>
      <h3>Age: {age}</h3>
      <button 
        onClick={ () => setName('Fernando!')}>
          Alterar
      </button>
      <button onClick={ () => setAge('44')}>
        Alterar
      </button>
      <hr/>
      <h3>E-mail: {email}</h3>
      <button
        onClick={ () => setEmail('devfernandouk@gmail.com')}>
          Alterar
      </button>

    </div>
  );
}

export default App;
